export default function Notes() {
    const [data, setdata] = useState({
        title : '',
        content : ''
    })
    return (
        <div>
            <h1><input type="text" name='title' value={data.value} /></h1>
            <p><textarea name="content" id="" cols="30" rows="10" value={data.content}></textarea></p>
        </div>
    )
}
